"use client";

import { useState } from "react";
import AdminDashboard from "../PortfolioPage/Portfolio_3/admindashboard";
import ShoppingChart from "../PortfolioPage/Portfolio_1/shoppingChart";
import RandomJoke from "../PortfolioPage/Portfolio_2/randomjoke";
import Calculator from "../PortfolioPage/Portfolio_4/calculator";
import NasaApp from "../PortfolioPage/Portfolio_5/nasapp";
import ToDoApp from "../PortfolioPage/Portfolio_6/todoapp";
import CountdownTimer from "../PortfolioPage/Portfolio_7/countdowntimer";
import PersonalWebPage from "../PortfolioPage/Portfolio_8/personalwebpage";
import WhatIsTheNextProject from "../PortfolioPage/Portfolio_9/whatisnextproject";

const SvgComponent = () => {
  const [activeComponent, setActiveComponent] = useState(null);

  const handleActiveComponent = (componentId) => {
    setActiveComponent(componentId);
  };

  const handleCloseModal = () => {
    setActiveComponent(null);
  };

  return (
    <div>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        viewBox="0 0 1440 470"
        preserveAspectRatio="xMidYMid meet"
        fill="none"
      >
        <path
          stroke="#FFFDFD"
          strokeDasharray="10 20"
          strokeWidth={2}
          d="m1151 436.5 60.5-203.5-230.849-25.408-179 149.5-34.658-212.414-144.343 62.914-128.999-142.5-168 119-196.686-95.355"
        />
        <path
          fill="url(#a)"
          d="M91.159 39.093h100v100h-100z"
          onClick={() => handleActiveComponent("component1")}
        />
        <path
          fill="url(#b)"
          d="M270.16 129.093h100v100h-100z"
          onClick={() => handleActiveComponent("component2")}
        />
        <path
          fill="url(#c)"
          d="M439.16 7.093h100v100h-100z"
          onClick={() => handleActiveComponent("component3")}
        />
        <path
          fill="url(#d)"
          d="M751.16 295.093h100v100h-100z"
          onClick={() => handleActiveComponent("component4")}
        />
        <path
          fill="url(#e)"
          d="M567.16 139.093h100v100h-100z"
          onClick={() => handleActiveComponent("component5")}
        />
        <path
          fill="url(#f)"
          d="M724.16 79.093h100v100h-100z"
          onClick={() => handleActiveComponent("component6")}
        />
        <path
          fill="url(#g)"
          d="M931.16 148.093h100v100h-100z"
          onClick={() => handleActiveComponent("component7")}
        />
        <path
          fill="url(#h)"
          d="M1107 371h100v100h-100z"
          onClick={() => handleActiveComponent("component9")}
        />
        <path
          fill="url(#i)"
          d="M1157 174h100v100h-100z"
          onClick={() => handleActiveComponent("component8")}
        />
        <defs>
          <pattern
            id="a"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#j" transform="scale(.01)" />
          </pattern>
          <pattern
            id="b"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#k" transform="scale(.01)" />
          </pattern>
          <pattern
            id="c"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#l" transform="scale(.01)" />
          </pattern>
          <pattern
            id="d"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#m" transform="scale(.01)" />
          </pattern>
          <pattern
            id="e"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#n" transform="scale(.01)" />
          </pattern>
          <pattern
            id="f"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#o" transform="scale(.01)" />
          </pattern>
          <pattern
            id="g"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#p" transform="scale(.01)" />
          </pattern>
          <pattern
            id="h"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#q" transform="scale(.01)" />
          </pattern>
          <pattern
            id="i"
            width={1}
            height={1}
            patternContentUnits="objectBoundingBox"
          >
            <use xlinkHref="#r" transform="scale(.01)" />
          </pattern>
          <image
            xlinkHref="data:image/png;base64,"
            id="j"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="k"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="l"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="m"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="n"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="o"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="p"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="q"
            width={100}
            height={100}
          />
          <image
            xlinkHref="data:image/png;base64,"
            id="r"
            width={100}
            height={100}
          />
        </defs>
      </svg>
      <ShoppingChart
        isOpen={activeComponent === "component1"}
        onOpenChange={() => handleCloseModal()}
      />
      <RandomJoke
        isOpen={activeComponent === "component2"}
        onOpenChange={() => handleCloseModal()}
      />
      <AdminDashboard
        isOpen={activeComponent === "component3"}
        onOpenChange={() => handleCloseModal()}
      />
      <ToDoApp
        isOpen={activeComponent === "component4"}
        onOpenChange={() => handleCloseModal()}
      />
      <NasaApp
        isOpen={activeComponent === "component6"}
        onOpenChange={() => handleCloseModal()}
      />
      <Calculator
        isOpen={activeComponent === "component5"}
        onOpenChange={() => handleCloseModal()}
      />

      <CountdownTimer
        isOpen={activeComponent === "component7"}
        onOpenChange={() => handleCloseModal()}
      />
      <PersonalWebPage
        isOpen={activeComponent === "component8"}
        onOpenChange={() => handleCloseModal()}
      />
      <WhatIsTheNextProject
        isOpen={activeComponent === "component9"}
        onOpenChange={() => handleCloseModal()}
      />
    </div>
  );
};
export default SvgComponent;
